import React from "react";
import FormControl from "@material-ui/core/FormControl";

export default props => (
  <FormControl margin="normal" required fullWidth>
    <InputLabel>Lastname</InputLabel>
    <Input id="lastname" autoFocus />
  </FormControl>
);
